Subroutine CouplingAhAhhhT(gt1,gt2,gt3,xiLR,xiR,alp,RHO1,rh3,ALP3,ALP1,               & 
& LAM1,etall,etalr,laml,lamlr,betl,err2,etarl,etarr,lamr,betr,BETA2,LAM3,v1,             & 
& v2,vtl,vtr,vhl,vhr,ZH,UP,res)

Implicit None 

Integer, Intent(in) :: gt1,gt2,gt3
Real(dp), Intent(in) :: xiLR,xiR,alp,RHO1,ALP3,ALP1,LAM1,BETA2,LAM3,v1,v2,vtl,vtr,vhl,vhr,ZH(6,6),UP(6,6)

Complex(dp), Intent(in) :: rh3,etall,etalr,laml,lamlr,betl,err2,etarl,etarr,lamr,betr

Complex(dp), Intent(out) :: res 
 
Integer :: j1,j2,j3,j4,j5,j6, j7, j8, j9, j10, j11, j12 
Iname = Iname +1 
NameOfUnit(Iname) = 'CouplingAhAhhh' 
 
If ((gt1.Lt.1).Or.(gt1.Gt.6)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt1 out of range', gt1 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt1 out of range', gt1 
  Call TerminateProgram 
End If 

If ((gt2.Lt.1).Or.(gt2.Gt.6)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt2 out of range', gt2 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt2 out of range', gt2 
  Call TerminateProgram 
End If 

If ((gt3.Lt.1).Or.(gt3.Gt.6)) Then 
  Write (ErrCan,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (ErrCan,*) 'index gt3 out of range', gt3 
  Write (*,*) 'Problem in Subroutine ',NameOfUnit(Iname) 
  Write (*,*) 'index gt3 out of range', gt3 
  Call TerminateProgram 
End If 

res = 0._dp 
res = res-2*LAM1*v1*UP(gt1,1)*UP(gt2,1)*ZH(gt3,1)
res = res-(BETA2*vtr*UP(gt1,4)*UP(gt2,1)*ZH(gt3,1))
res = res+BETA2*vtl*UP(gt1,6)*UP(gt2,1)*ZH(gt3,1)
res = res-2*LAM1*v1*UP(gt1,2)*UP(gt2,2)*ZH(gt3,1)
res = res-4*LAM3*v1*UP(gt1,2)*UP(gt2,2)*ZH(gt3,1)
res = res-(betl*v1*UP(gt1,3)*UP(gt2,3)*ZH(gt3,1))
res = res-(BETA2*vtr*UP(gt1,1)*UP(gt2,4)*ZH(gt3,1))
res = res-(ALP1*v1*UP(gt1,4)*UP(gt2,4)*ZH(gt3,1))
res = res+BETA2*v1*UP(gt1,6)*UP(gt2,4)*ZH(gt3,1)
res = res-(betr*v1*UP(gt1,5)*UP(gt2,5)*ZH(gt3,1))
res = res+BETA2*vtl*UP(gt1,1)*UP(gt2,6)*ZH(gt3,1)
res = res+BETA2*v1*UP(gt1,4)*UP(gt2,6)*ZH(gt3,1)
res = res-(ALP1*v1*UP(gt1,6)*UP(gt2,6)*ZH(gt3,1))
res = res-2*LAM1*v2*UP(gt1,1)*UP(gt2,1)*ZH(gt3,2)
res = res-4*LAM3*v2*UP(gt1,1)*UP(gt2,1)*ZH(gt3,2)
res = res-2*LAM1*v2*UP(gt1,2)*UP(gt2,2)*ZH(gt3,2)
res = res-(betl*v2*UP(gt1,3)*UP(gt2,3)*ZH(gt3,2))
res = res-(alp*vtr*UP(gt1,5)*UP(gt2,3)*ZH(gt3,2))/2._dp
res = res-((xiLR*UP(gt1,5)*UP(gt2,3)*ZH(gt3,2))/sqrt(2._dp))
res = res+(alp*vhr*UP(gt1,6)*UP(gt2,3)*ZH(gt3,2))/2._dp
res = res-(ALP1*v2*UP(gt1,4)*UP(gt2,4)*ZH(gt3,2))
res = res-(ALP3*v2*UP(gt1,4)*UP(gt2,4)*ZH(gt3,2))
res = res-(alp*vtr*UP(gt1,3)*UP(gt2,5)*ZH(gt3,2))/2._dp
res = res-((xiLR*UP(gt1,3)*UP(gt2,5)*ZH(gt3,2))/sqrt(2._dp))
res = res-(betr*v2*UP(gt1,5)*UP(gt2,5)*ZH(gt3,2))
res = res+(alp*vhl*UP(gt1,6)*UP(gt2,5)*ZH(gt3,2))/2._dp
res = res+(alp*vhr*UP(gt1,3)*UP(gt2,6)*ZH(gt3,2))/2._dp
res = res+(alp*vhl*UP(gt1,5)*UP(gt2,6)*ZH(gt3,2))/2._dp
res = res-(ALP1*v2*UP(gt1,6)*UP(gt2,6)*ZH(gt3,2))
res = res-(ALP3*v2*UP(gt1,6)*UP(gt2,6)*ZH(gt3,2))
